INSERT INTO `gym_reviews` (`gym_review_id`, `gym_mark`, `gym_review_descript`, `user_id`, `gym_id`) VALUES
(0, 3, 'Brudno i na salach niezbyt dobrze pachnie...???', 0, 7),
(1, 5, 'adna, zadbana siownia, duo sprztu, przemia obsuga ?.', 1, 7),
(2, 2, 'Mega lans jeli nie masz obcisych ciuchw i nie napijesz sobie skarpety w kroku to bdziesz poczegany za leszcza???', 2, 6),
(3, 3, 'Szkoda ze tylko abonamenty....?', 3, 1),
(4, 4, 'Fajna siownia masa sprztu i maszyn mona konkretnie powiczy cho w niektrych godzinach jest naprawd toczno i trzeba czeka a kto skoczy lub wiczy na zmian.', 4, 5),
(5, 3, 'Fajna siownia, mia obsuga. Troch mao urzdze. Fajne zajcia. Bd musia tu wrci.?', 5, 1),
(6, 5, 'Super! Mao osb, czysto, duo dobrego sprztu - polecam gorco ??', 6, 1),
(7, 5, 'Moim zdaniem najlepsza siownia', 7, 5),
(8, 5, 'Najlepsza i najnowoczeniejsza siownia w okolicy ??.', 8, 5),
(9, 2, 'Nie fjniw i syf', 9, 3),
(10, 5, 'Duo sprztu.?? Mia obsuga zawsze gotowa do pomocy. Godziny otwarcia to bajka i to za cen karnetu w Polsce. Gorco polecam', 10, 0),
(11, 5, 'Bardzo czysto, przyjemnie, sprzt zadbany, mia obsuga', 11, 0),
(12, 5, 'Dobry duzy klub z parkingiem. Duza powierzchnia ze sprzetem do treningu silowego jak i kardio.??', 12, 6),
(13, 3, 'Brudno i na salach niezbyt dobrze pachnie...???', 13, 3),
(14, 3, 'Miejsce ok.', 14, 0),
(15, 2, 'azienki w fatalnym stanie ??. Rowalajace si szafki.', 15, 7),
(16, 2, 'Stare, ale sprawne sprzty. Brak klimy i szatnia w toalecie', 16, 1),
(17, 2, 'Nie fjniw i syf', 17, 1),
